import React from 'react'
import Courses from './Courses';
import { Dummydata } from './Dummydata'
const CourseList = () => {

  const cartData=useSelector(state=>state)
  
  return (
    <>
    <div className="container">
      <div className="row">
        { 
        Dummydata.map((ele)=>{       
                return (<Courses
                    key={ele.id} 
                    id={ele.id}
                     title={ele.title}
                    description={ele.description}
                    price={ele.price}
                    img={ele.img}
                />)
        })
        }
        </div>
        </div>
      
    </>
  )
}

export default CourseList
